import React from "react";

function Services() {
  return (
    <div className="services"style={{backgroundColor:"#f2f3f5"}}>

      <h2 style={{textAlign:"center",fontWeight:"400"}}>Get in Touch With Us</h2>

      <button id="button1">FREE TRIAL</button>


    </div>
  );
}

export default Services;
